import "../App.css";
import { useFormik } from "formik";
import axios from "axios";
import * as yup from "yup";
import reg from "../image/connect.webp";
import cnt from "../image/connect.svg";
import { toast, ToastContainer } from "react-toastify";
import { Link, useNavigate } from "react-router-dom";
import "./style.css";
import {
  EnvelopeFill,
  EnvelopeOpenFill,
  HeartFill,
  LockFill,
  PersonFill,
  PersonPlus,
} from "react-bootstrap-icons";
import { useState } from "react";
function Guestregister() {
  let [submit, setSubmit] = useState(false);
  let navigate = useNavigate();
  let formik = useFormik({
    initialValues: {
      email: "",
      password: "",
      fullName: "",
      recoveryEmail: "",
    },
    validationSchema: yup.object({
      email: yup
        .string()
        .email()
        .required("email is required")
        .strict(true)
        .trim("no space is allowed"),
      password: yup
        .string()
        .required("this field is required")
        .min(8, "password should be more than 8 letters")
        .max(15, "password should be less than 15 letters ")
        .strict(true)
        .trim("no space is required"),
      fullName: yup
        .string()
        .required("this field is required")
        .min(3, "length of the name should be more than 3 letters")
        .max(30, "length of the name should by less than 30 letters"),
      aboutInterest: yup.string().required("you should mention your interest"),
      recoveryEmail: yup
        .string()
        .email()
        .notOneOf(
          [yup.ref("email"), null],
          "recovery email should be differ from email"
        )
        .required("recovery email should be required"),
    }),
    onSubmit: (data) => {
      setSubmit(true);
      axios
        .post(
          process.env.REACT_APP_BACKEND_URL + "/register/attendeeRegister",
          data
        )
        .then((res) => {
          toast.success(res.data);
          navigate("/");
        })
        .catch((err) => {
          setSubmit(false);
          toast.error(err.response.data);
        });
    },
  });
  return (
    <>
      <section className="register-layout">
        <h3>Lateform.</h3>
        <div className="inner-con-div">
          <div className="img-vec">
            <svg
              width="100%"
              height="100%"
              viewBox="0 0 982 624"
              fill="none"
              xmlns="http://www.w3.org/2000/svg"
              xmlnsXlink="http://www.w3.org/1999/xlink"
            >
              <rect x={-77} width={1059} height={624} fill="url(#pattern0)" />
              <defs>
                <pattern
                  id="pattern0"
                  patternContentUnits="objectBoundingBox"
                  width={1}
                  height={1}
                >
                  <use
                    xlinkHref="#image0_764_459"
                    transform="matrix(0.000944287 0 0 0.00160256 0 -1.34776)"
                  />
                </pattern>
                <image
                  id="image0_764_459"
                  width={1059}
                  height={2000}
                  xlinkHref="data:image/png;base64,"
                />
              </defs>
            </svg>
          </div>
          <div className="content-rght">
            <h1>Welcome to LateForm. </h1>
            <div className="progress-bar">
              <div />
              <div />
              <div />
              <div />
            </div>
            <form className="p-3" onSubmit={formik.handleSubmit}>
              <div className="form-group">
                <input
                  type="text"
                  placeholder="Full name"
                  className="form-control"
                  name="fullName"
                  value={formik.values.fullName}
                  onChange={formik.handleChange}
                />
                {formik.errors.fullName ? (
                  <p className="text-danger">{formik.errors.fullName}</p>
                ) : null}
              </div>

              <div className="">
                
                <input
                  type="email"
                  placeholder="Email*"
                  className="form-control"
                  name="email"
                  value={formik.values.email}
                  onChange={formik.handleChange}
                />
                {formik.errors.email ? (
                  <p className="text-danger">{formik.errors.email}</p>
                ) : null}
              </div>

              <div className="form-group">
                <input
                  type="password"
                  placeholder="Password*"
                  className="form-control"
                  name="password"
                  value={formik.values.password}
                  onChange={formik.handleChange}
                />
                {formik.errors.password ? (
                  <p className="text-danger">{formik.errors.password}</p>
                ) : null}
              </div>

              <div className="form-group">
                <input
                  type="text"
                  placeholder="I am interested in ..."
                  className="form-control"
                  name="aboutInterest"
                  value={formik.values.aboutInterest}
                  onChange={formik.handleChange}
                />
                {formik.errors.aboutInterest ? (
                  <p className="text-danger">{formik.errors.aboutInterest}</p>
                ) : null}
              </div>

              <div className="form-group">
                <input
                  type="email"
                  placeholder="recovery email"
                  className="form-control"
                  name="recoveryEmail"
                  value={formik.values.recoveryEmail}
                  onChange={formik.handleChange}
                />
                {formik.errors.recoveryEmail ? (
                  <p className="text-danger">{formik.errors.recoveryEmail}</p>
                ) : null}
              </div>
              {submit === false ? (
                <button>
                  sign up
                </button>
              ) : (
                <button>loading...</button>
              )}
              {/* <Link
                to="/organizerLogin"
                className="mt-5 text-center text-decoration-none text-wrap"
              >
                already have a account?login in as an Attendee
              </Link> */}
            </form>
          </div>
        </div>
      </section>
      
      <ToastContainer />
    </>
  );
}
export default Guestregister;
